		private static Dictionary<char, int> charCountDict = new Dictionary<char, int>(inputArray.Length);

		static void Main(string[] args)
		{
			for (int i = 0; i < inputArray.Length; i++)
			{
				if (charCountDict.ContainsKey(inputArray[i]))
				{
					charCountDict[inputArray[i]]++;
				}
				else
				{
					charCountDict.Add(inputArray[i], 1);
				}
			}

			StringBuilder resultStr = new StringBuilder();
			for (int i = 0; i < inputArray.Length; i++)
			{
				if (charCountDict[inputArray[i]] < 10)
				{
					resultStr.Append(inputArray[i]);
				}
			}

			Console.WriteLine(resultStr.ToString());
			Console.ReadKey();
		}
	}
